import React from 'react'

export const FechaFicha = (props) => {
    const {datosFicha} = props
    return (
        <div className="card">
            <div className="card-header">
                <div className="card-body">
                    {datosFicha.FechaFicha}
                </div>
            </div>
        </div>
    )
}
